	(56,35,NULL,'2015-12-23 01:00:19',NULL,36,36,NULL,2,58,'exactMatch','has exact match','skos:exactMatch is used to link two concepts, indicating a high degree of confidence that the concepts can be used interchangeably across a wide range of information retrieval applications. skos:exactMatch is a transitive property, and is a sub-property of skos:closeMatch.','skos:exactMatch is disjoint with each of the properties skos:broadMatch and skos:relatedMatch.','property','skos:exactMatch',1,'en',NULL,NULL,540,540,NULL,0,1,0,1,1,56,0,0,1,0,0,0,1,0,'http://www.w3.org/2004/02/skos/core#'),
	(57,36,NULL,'2015-12-23 01:00:19',NULL,36,36,NULL,2,58,'closeMatch','has close match','skos:closeMatch is used to link two concepts that are sufficiently similar that they can be used interchangeably in some information retrieval applications. In order to avoid the possibility of "compound errors" when combining mappings across more than two concept schemes, skos:closeMatch is not declared to be a transitive property.',NULL,'property','skos:closeMatch',1,'en',NULL,NULL,530,530,NULL,0,1,0,1,1,57,0,0,1,0,0,0,1,0,'http://www.w3.org/2004/02/skos/core#'),
	(58,37,NULL,'2015-12-23 01:00:19',NULL,36,36,NULL,2,NULL,'mappingRelation','is in mapping relation with','Relates two concepts coming, by convention, from different schemes, and that have comparable meanings','These concept mapping relations mirror semantic relations, and the data model defined below is similar (with the exception of skos:exactMatch) to the data model defined for semantic relations. A distinct vocabulary is provided for concept mapping relations, to provide a convenient way to differentiate links within a concept scheme from links between concept schemes. However, this pattern of usage is not a formal requirement of the SKOS data model, and relies on informal definitions of best practice.','property','skos:mappingRelation',1,'en',NULL,NULL,490,490,NULL,0,0,0,1,1,NULL,0,0,1,0,0,0,1,0,'http://www.w3.org/2004/02/skos/core#'),
