	(1289,'2008-05-25 06:39:57','2016-07-11 19:31:22',NULL,NULL,NULL,422,475,NULL,5,'A media type used to store recorded sound, designed for use with a playback device such as a turntable, audiocassette player, CD player, or MP3 player.',37,NULL,'en',1,0,0,37),
	(1290,'2008-05-25 06:40:56','2016-07-11 19:31:22',NULL,NULL,NULL,422,477,NULL,5,'A media type used to store electronic files, designed for use with a computer.',37,NULL,'en',1,0,0,37),
	(1291,'2008-05-25 06:41:49','2016-07-11 19:31:22',NULL,NULL,NULL,422,476,NULL,5,'A media type used to store reduced-size images not readable to the human eye, designed for use with a device such as a microfilm or microfiche reader.',37,NULL,'en',1,0,0,37),
	(1292,'2008-05-25 06:42:26','2016-07-11 19:31:23',NULL,NULL,NULL,422,478,NULL,5,'A media type used to store minute objects, designed for use with a device such as a microscope to reveal details invisible to the naked eye.',37,NULL,'en',1,0,0,37),
	(1293,'2008-05-25 06:43:09','2016-07-11 19:31:23',NULL,NULL,NULL,422,479,NULL,5,'A media type used to store moving or still images, designed for use with a projection device such as a motion picture film projector, slide projector, or overhead projector.',37,NULL,'en',1,0,0,37),
	(1294,'2008-05-25 06:44:57','2016-07-11 19:31:23',NULL,NULL,NULL,422,480,NULL,5,'A media type used to store pairs of still images, designed for use with a device such as a stereoscope or stereograph viewer to give the effect of three dimensions.',37,NULL,'en',1,0,0,37),
	(1295,'2008-05-25 06:45:50','2016-07-11 19:31:23',NULL,NULL,NULL,422,481,NULL,5,'A media type used to store content designed to be perceived directly through one or more of the human senses without the aid of an intermediating device.',37,NULL,'en',1,0,0,37),
