	(14328,'2014-01-19 03:43:38','2016-12-16 13:58:42',NULL,422,422,83,'Work','work','A distinct intellectual or artistic creation, that is, the intellectual or artistic content.','','class',25154,'http://rdaregistry.info/Elements/c/C10013','http://rdaregistry.info/Elements/c/C10001',1,'en','','','',NULL,NULL,'http://rdaregistry.info/Elements/c/Work.en',''),
	(14329,'2014-01-19 03:43:38','2016-12-16 13:59:04',NULL,422,422,83,'Agent','agent','A person, family, or corporate body.','','class',25154,'http://rdaregistry.info/Elements/c/C10013','http://rdaregistry.info/Elements/c/C10002',1,'en','','','',NULL,NULL,'http://rdaregistry.info/Elements/c/Agent.en',''),
	(14330,'2014-01-19 03:43:38','2016-12-16 13:55:21',NULL,422,422,83,'Item','item','A single exemplar or instance of a manifestation.',NULL,'class',25154,'http://rdaregistry.info/Elements/c/C10013','http://rdaregistry.info/Elements/c/C10003',1,'en',NULL,NULL,NULL,NULL,NULL,'http://rdaregistry.info/Elements/c/Item.en',''),
	(14331,'2014-01-19 03:43:38','2016-12-16 13:55:20',NULL,422,422,83,'Person','person','An individual or an identity established by an individual, either alone or in collaboration with one or more other individuals.',NULL,'class',14329,'http://rdaregistry.info/Elements/c/C10002','http://rdaregistry.info/Elements/c/C10004',1,'en',NULL,NULL,NULL,NULL,NULL,'http://rdaregistry.info/Elements/c/Person.en',''),
	(14332,'2014-01-19 03:43:38','2016-12-16 13:55:21',NULL,422,422,83,'CorporateBody','corporate body','An organization or group of persons and/or organizations that is identified by a particular name and that acts, or may act, as a unit.',NULL,'class',25152,'http://rdaregistry.info/Elements/c/C10011','http://rdaregistry.info/Elements/c/C10005',1,'en',NULL,NULL,NULL,NULL,NULL,'http://rdaregistry.info/Elements/c/CorporateBody.en',''),
	(14333,'2014-01-19 03:43:38','2016-12-16 13:55:21',NULL,422,422,83,'Expression','expression','An intellectual or artistic realization of a work in the form of alpha-numeric, musical or choreographic notation, sound, image, object, movement, etc., or any combination of such forms.',NULL,'class',25154,'http://rdaregistry.info/Elements/c/C10013','http://rdaregistry.info/Elements/c/C10006',1,'en',NULL,NULL,NULL,NULL,NULL,'http://rdaregistry.info/Elements/c/Expression.en',''),
	(14334,'2014-01-19 03:43:38','2016-12-16 13:55:21',NULL,422,422,83,'Manifestation','manifestation','A physical embodiment of an expression of a work.',NULL,'class',25154,'http://rdaregistry.info/Elements/c/C10013','http://rdaregistry.info/Elements/c/C10007',1,'en',NULL,NULL,NULL,NULL,NULL,'http://rdaregistry.info/Elements/c/Manifestation.en',''),
	(14335,'2014-01-19 03:43:38','2016-12-16 13:55:21',NULL,422,422,83,'Family','family','Two or more persons related by birth, marriage, adoption, civil union, or similar legal status, or who otherwise present themselves as a family.',NULL,'class',25152,'http://rdaregistry.info/Elements/c/C10011','http://rdaregistry.info/Elements/c/C10008',1,'en',NULL,NULL,NULL,NULL,NULL,'http://rdaregistry.info/Elements/c/Family.en',''),
	(22989,'2016-07-11 21:38:17','2016-12-16 13:55:21',NULL,422,422,83,'Place','place','A given extent of space.',NULL,'class',25154,'http://rdaregistry.info/Elements/c/C10013','http://rdaregistry.info/Elements/c/C10009',1,'en',NULL,NULL,NULL,NULL,NULL,'http://rdaregistry.info/Elements/c/Place.en',''),
	(25151,'2016-12-16 13:55:21','2016-12-16 14:00:15',NULL,422,422,83,'Timespan','time-span','A temporal extent having a beginning, an end and a duration.','','class',25154,'http://rdaregistry.info/Elements/c/C10013','http://rdaregistry.info/Elements/c/C10010',1,'en','','','',NULL,NULL,'http://rdaregistry.info/Elements/c/Timespan.en',''),
	(25152,'2016-12-16 13:55:21','2016-12-16 13:57:48',NULL,422,422,83,'CollectiveAgent','collective agent','A gathering or organization of persons bearing a particular name and capable of acting as a unit.','','class',25154,'http://rdaregistry.info/Elements/c/C10013','http://rdaregistry.info/Elements/c/C10011',1,'en','A collective agent includes a corporate body and a family.','','',NULL,NULL,'http://rdaregistry.info/Elements/c/CollectiveAgent.en',''),
	(25153,'2016-12-16 13:55:21','2016-12-16 14:00:42',NULL,422,422,83,'Nomen','nomen','A designation that refers to an RDA entity.','','class',25154,'http://rdaregistry.info/Elements/c/C10013','http://rdaregistry.info/Elements/c/C10012',1,'en','A designation includes a name, title, access point, identifier, and subject classification codes and headings.','','',NULL,NULL,'http://rdaregistry.info/Elements/c/Nomen.en',''),
	(25154,'2016-12-16 13:55:21','2017-02-10 11:55:04',NULL,422,422,83,'RDAEntity','RDA entity','An abstract class of key conceptual objects in the universe of human discourse that is a focus of interest to users of RDA metadata in library information systems.','','class',25173,'','http://rdaregistry.info/Elements/c/C10013',1,'en','An RDA entity includes an agent, collective agent, corporate body, expression, family, item, manifestation, nomen, person, place, time-span, and work.','','',NULL,NULL,'http://rdaregistry.info/Elements/c/RDAEntity.en','');
